import React from 'react';
import './AboutUs.css';

function AboutUs() {
  return (
    <div className="about-us">
      <h1>About Us</h1>
      <p>Health&me is dedicated to improving your health through proper food, exercise, and guidance.</p>
      <img src="about.jpg" alt="About Us" />
    </div>
  );
}

export default AboutUs;
